column8:
メーカー希望小売価格はメーカー商品タグに基づいて掲載しています<br>

<p>ミニマルなデザインがオフィスシーンにもパーティーシーンにも大活躍なCECILEコレクション。小さ目のトップリングとローマ数字の組み合わせがクラシカルでシックな印象を演出。</p>


<h5>フォッシル[FOSSIL]とは？</h5>
<p>独創的なデザインで世界100ヶ国以上で愛用されているフォッシルは、アメリカを代表するライフスタイルブランド。<br>
1984年、時計メーカーとして始まったフォッシルは、時計をファッションアクセサリーの一つと考え、<br>
カジュアルな「TREND」ラインからフォーマルなシーンにも使える「CERAMIC」など、<br>
年間300種類以上のモデルを発売し続けています。またフォッシル直営店では、<br>
時計以外にもレザーバッグ、革小物、ファッションサングラスなどのラインも展開しており、<br>
世界観を次々と広げているブランドです。</p>


